export const DatasourceEventTypes = {
    itemsAdded: "itemsAdded",
    itemsUpdated: "itemsUpdated",
    itemsDeleted: "itemsDeleted",
    stateChanged: "stateChanged",
    selectionChanged: "selectionChanged",

    // used to send data collection count back during batch operations
    fetchingData: "fetchingData",

    // notify visualization that we are starting to collect data on the datasource
    dataCollectionStarted: "dataCollectionStarted",

    // notify visualization that we have stopped collecting data on the datasource
    dataCollectionEnded: "dataCollectionEnded"
};